import { StyleSheet } from "react-native";

const styles = StyleSheet.create({

    container: {
        width: 30,
        height: 30,
        borderRadius: 8,
    },

    textInput: {
        flex: 1,
        marginRight: 40,
        marginLeft: 10,
        color: "#999",
        backgroundColor: "#333",
    },

    boxButtonSearch: {
        width: 30,
        height: 30,
        position: "absolute",
        right: 0,
        backgroundColor: "#252525",
    }
});

export default styles;
